import React, { Component } from 'react';
class Header extends Component{
    render(){

        const{ navigation } = this.props;
        const headerList = navigation.map(navItem => {
            if (navItem.name === "header"){
               return(
                   <ul key={navItem.id}>
                        <li><a href={navItem.links.projects}>projects</a></li>
                        <li><a href="#">art</a></li>
                        <li><a href="#">about</a></li>
                        <li><a href="#">contact</a></li>
                    </ul>
               )
            }
        })
        return (
            <header>
                <nav>
                    <svg height="100" width="100">
                        <circle cx="25" cy="25" r="30" stroke="none" fill="#c76d14" />
                    </svg>
                    {/* <a className="logo" href="/"><img src='https://i.ibb.co/T4fTd8j/dogbread.png' alt="Logo" /></a> */}
                    { headerList } 
                </nav>
            </header>
        )
    }
}

export default Header;
